            id="adr"
             name="adr"
              placeholder="542 W. 15th Street"
            
             value={chaeckOutdata.adr}
             onChange={handleChnge}
             />
            <label for="city"><i class="fa fa-institution"></i> City</label>
            <input type="text" 
            id="city"
            value={chaeckOutdata.city}
            onChange={handleChnge}
            name="city"
             placeholder="New York"
             required/>

            <div class="row">
              <div class="col-50">
                <label for="state">State</label>
                <input 
                type="text"
                 id="state" 
                 name="state" 
                 value={chaeckOutdata.state}
                 onChange={handleChnge}
                 placeholder="NY" 
                 required/>
              </div>
              <div class="col-50">
                <label for="zip">Zip</label>
                <input type="text" 
                id="zip" 
                name="zip" 
                placeholder="10001"
                 minLength={5} maxLength={6}
                 value={chaeckOutdata.zip}
                 onChange={handleChnge}
                 required/>
              </div>
            </div>
          </div>

          <div class="col-50">
            <h3>Payment</h3>
            <label for="fname">Accepted Cards</label>
            <div class="icon-container">
              <i class="fa fa-cc-visa" style={{color:"navy"}}></i>
              <i class="fa fa-cc-amex" style={{color:"blue"}}></i>
              <i class="fa fa-cc-mastercard" style={{color:"red"}}></i>
              <i class="fa fa-cc-discover" style={{color:"orange"}}></i>
            </div>
              <label for="pprice">TotalPrice</label>
              <input type="text" value={totalprice}/>
            <label for="cname">Name on Card</label>
            <input type="text" 
            id="cname"
             name="cname"
              placeholder="John More Doe"
               required minLength={4} 
               maxLength={10}
               value={chaeckOutdata.cname}
               onChange={handleChnge}
               />
            <label for="ccnum">Credit card number</label>
            <input type="text"
             id="ccnum"
              name="ccnum" 
              placeholder="1111-2222-3333-4444" 
              required 
              minLength={16} 
              maxLength={16}
              value={chaeckOutdata.cardnumber}
              onChange={handleChnge}
              />
            <label for="expmonth">Exp Month</label>
            <input type="text" 
            id="expmonth" 
            name="expmonth" 
            placeholder="September" 
            required 
            value={chaeckOutdata.expmonth}
            onChange={handleChnge}
            minLength={3}
            maxLength={4}
            />
            <div class="row">
            
              <div class="col-50">
                <label for="expyear">Exp Year</label>
                <input type="text"
                 id="expyear"
                  name="expyear" 
                  placeholder="2018"
                   required minLength={4}
                    maxLength={4}
                    value={chaeckOutdata.expyear}
                     onChange={handleChnge}
                    />
              </div>
              
              <div class="col-50">
                <label for="cvv">CVV</label>
                <input type="text"
                 id="cvv"
                  name="cvv"
                   placeholder="352" 
                   required
                    minLength={3} 
                    maxLength={3}
                    value={chaeckOutdata.cvv}
                     onChange={handleChnge}
                    />
              </div>
              
            </div>
          </div>
          
        </div>
        <label>
          <input type="checkbox"  name="sameadr" required /> Shipping address same as billing
        </label>
   
        <input type="submit" value="Continue to checkout" class="button" />
      </form>
    </div>
  </div>
  </div>
  </>
        
    );
 }

 export default CheckOut;
